    "#There are no duplicate rows. Great!!\n",
    "\n",
    "  \n",
    "  \n",
    "## Checking for outliers in numeric data\n",
    "# Box plots for numerical data to identify outliers\n",
    "library(rlang)  \n",
    "\n",
    "numerical_vars <- c(\"Age\", \"Purchase.Amount..USD.\", \"Previous.Purchases\")\n",
    "\n",
    "for (var in numerical_vars) {\n",
    "  p <- ggplot(Shoppingbehavior, aes(x = \"\", y = !!sym(var))) +\n",
    "    geom_boxplot() +\n",
    "    labs(title = paste(\"Box Plot for\", var),\n",
    "         x = \"\",\n",
    "         y = var) +\n",
    "    theme_minimal()\n",
