    "# The relationship between Age and Purchase Amount is not linear i.e Age does not determine the purchase amount. Everyone buys how they want basically.\n",
    "# I want to determine the most poular products that are being purchased.\n",
    "names(Shoppingbehavior)\n",
    "\n",
    "# Top 10 popular products \n",
    "top_products <- Shoppingbehavior %>%\n",
    "  group_by(`Item.Purchased`) %>%\n",
    "  summarise(Count = n()) %>%\n",
    "  arrange(desc(Count)) %>%\n",
    "  top_n(10) \n",
    "print(top_products)"
   ]
