   "source": [
    "# I want to add some color so i plot a bar chart.\n",
    "# Bar chart for popular products\n",
    "ggplot(top_products, aes(x = reorder(`Item.Purchased`, -Count), y = Count, fill = `Item.Purchased`)) +\n",
    "  geom_bar(stat = \"identity\") +\n",
    "  labs(title = \"Top 10 Popular Products\",\n",
    "       x = \"Item Purchased\",\n",
    "       y = \"Count\") +\n",
    "  theme(axis.text.x = element_text(angle = 45, hjust = 1))"
   ]
