   "source": [
    "# What Segments have the most buyers?\n",
    "top_segments <- Shoppingbehavior %>%\n",
    "  group_by(`Category`) %>%\n",
    "  summarise(Count = n()) %>%\n",
    "  arrange(desc(Count)) %>%\n",
    "  top_n(5)\n",
    "\n",
    "ggplot(top_segments, aes(x = reorder(`Category`, -Count), y = Count, fill = `Category`)) +\n",
    "  geom_bar(stat = \"identity\") +\n",
    "  labs(title = \"Top 5 Active Customer Segments\",\n",
    "       x = \"Category\",\n",
    "       y = \"Count\") +\n",
    "  theme(axis.text.x = element_text(angle = 45, hjust = 1))"
   ]
