    "#We have a winner, ding, ding, ding. Clothing is the most popular segment\n",
    "# Faceted Scatter Plot for Age vs Purchase Amount, faceted by Gender\n",
    "ggplot(Shoppingbehavior, aes(x = Age, y = 'Purchase Amount(USD)', color = Gender)) +\n",
    "  geom_point(alpha = 0.7) +\n",
    "  labs(title = \"Age vs Purchase Amount - Faceted by Gender\",\n",
    "       x = \"Age\",\n",
    "       y = \"Purchase Amount (USD)\") +\n",
    "  facet_wrap(~Gender) +\n",
    "  theme_minimal()\n"
   ]
