    "#I believe the amount of purchases made by men and women are basically the same. Though we have more men than women, they both have identical shopping costs \n",
    "\n",
    "# Violin Plot for Relationship between Previous Purchase and Season\n",
    "ggplot(Shoppingbehavior, aes(x = 'Previous.Purchases', y = Season, fill = 'Previous.Purchases')) +\n",
    "  geom_violin() +\n",
    "  labs(title = \"Relationship between Previous Purchases and Season\",\n",
    "       x = \"Previous Purchases\",\n",
    "       y = \"Season\") +\n",
    "  theme_minimal()\n"
   ]
