    "#The above plot suggests that Outwear has more consistent ratings as the median line is higher inside the box\n",
    "\n",
    "# Stacked Bar Chart for Distribution of Purchases by Category and Gender\n",
    "ggplot(Shoppingbehavior, aes(x = Category, fill = Gender)) +\n",
    "  geom_bar(position = \"stack\") +\n",
    "  labs(title = \"Distribution of Purchases by Category and Gender\",\n",
    "       x = \"Category\",\n",
    "       y = \"Count\") +\n",
    "  theme(axis.text.x = element_text(angle = 45, hjust = 1))\n"
   ]
