   "source": [
    "# Relationship between Frequency of Purchases and Season\n",
    "\n",
    "frequency_columns <- c(\"Weekly\", \"Monthly\", \"Quarterly\", \"Annually\", \"Every.3.Months\")\n",
    "\n",
    "melted_data <- reshape2::melt(EncodedSb, id.vars = c(\"Season\"), measure.vars = frequency_columns)\n",
    "\n",
    "# Plotting relationship between Frequency of Purchases and Season\n",
    "ggplot(melted_data, aes(x = Season, y = value, fill = variable)) +\n",
    "  geom_bar(stat = \"summary\", fun = \"mean\", position = \"dodge\") +\n",
