   "source": [
    "# Load necessary libraries\n",
    "library(tidyr)\n",
    "library(reshape2)\n",
    "\n",
    "# Selecting numerical variables for clustering, including encoded frequency columns\n",
    "numerical_vars <- c(\"Age\", \"Purchase.Amount..USD.\", \"Previous.Purchases\", \"Weekly\", \"Monthly\", \"Annually\", \"Bi.Weekly\", \"Every.3.Months\")\n",
    "\n",
    "# Extracting numerical features\n",
    "numerical_data <- EncodedSb[, numerical_vars]\n",
    "\n",
    "# Visualizing the distribution of numerical features \n",
    "ggplot(melt(numerical_data), aes(x = variable, y = value)) +\n",
    "  geom_boxplot() +\n",
    "  labs(title = \"Distribution of Numerical Features\") +\n",
    "  theme_minimal()\n",
    "\n",
    "# Normalizing the numerical features\n",
    "scaled_data <- scale(numerical_data)\n",
    "\n",
    "# K-means Clustering\n",
    "kmeans_model <- kmeans(scaled_data, centers = 5)  \n",
    "\n",
    "# Add cluster information to the original data\n",
    "EncodedSb$Cluster <- factor(kmeans_model$cluster)\n",
    "\n",
    "# Visualize clusters\n",
